def transform(sequence):
    result = ['0'] * len(sequence)
    ones = [i for i, c in enumerate(sequence) if c == '1']
    nines = [i for i, c in enumerate(sequence) if c == '9']
    for i in ones:
        result[i] = '1'
    for i in nines:
        result[i] = '9'
    for i, c in enumerate(sequence):
        if c != '1' and c != '9':
            result[i] = c
    return ''.join(result)
